.css-button-retro--blue{
     min-width:130px;
     height:40px;
     padding:5px 10px;
     font-weight:700;
     cursor:pointer;
     transition:.3s;
     position:relative;
     display:inline-block;
     outline:0;
     border:1px solid #000;
     color:#000;
     background:0 0;
     z-index:0
}
.css-button-retro--blue:hover:after{
     top:0;
     left:0
}
.css-button-retro--blue:after{
     content:'';
     width:100%;
